import React from "react";
import IQuestion from "../../Models/IQuestion";
import Style1 from "./Style1/Style1";
import Style2 from "./Style2/Style2";
import Style3 from "./Style3/Style3";

interface IProps {
  question: IQuestion;
  position: number;
}

const Question: React.FC<IProps> = ({ question, position }) => {

  let style = null;
  switch (question.style) {
    case 1:
      style = <Style1 question={question} />;
      break;
    case 2:
      style = <Style2 question={question} />;
      break;
    case 3:
      style =  <Style3 question={question} />;
    default:
      return <Style1 question={question} />;
  }
};

export default Question;
